import {
    EXAMPLE_ACTION
} from '../actions/BookActions'


const initialState = {

    example : [
        {name : 'Agung Septiyadi',age:22},
        {name : 'Ibnu Yasin', age:23}
    ]
}
export default (state = initialState, action) => {
    switch (action.type) {
        case EXAMPLE_ACTION:
            var example = [...state.example]
            example.push({name:'Ivan',age:19})
            return {
                example
            }
        default:
            return state
    }
}
